import { createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  "& .MuiLinearProgress-colorPrimary": {
    backgroundColor: "#E8E8E8"
  },
  "& .MuiLinearProgress-barColorPrimary": {
    backgroundColor: "#009F51"
  },
  palette: {
    primary: {
      main: '#000',
    },
    secondary: {
      main: '#000',
    },

  },

});

export default theme;
